import React from 'react'
import { useState } from 'react'
import { Form, Button } from "react-bootstrap"


const MainContact = () => {

    const consultas = [{ 
      id: 1, nombre: "liliana diaz", email: "lili2022@gmail.com", descripcion: "quiero realizar una app" },
    { id: 2, nombre: "carlos lopez", email: "carlin@gmail.com", descripcion: "necesito un presupuesto" },
    { id: 3, nombre: "diego ramirez", email: "dieguito21@gmail.com", descripcion: "necesito comunicarme con vos" }
    ]

    const [pedidos,setPedidos] = useState(consultas)
    const [nombre, setNombre] = useState("")
    const [email, setEmail] = useState("")
    const [descripcion, setDescripcion] = useState("")

    const myStyles = {
        width: "60%",
        backgroundColor: "orange"
    }

    const handlerChange = (e) => {
        setEmail(e.target.value)
    }


    return (
        <>
            <br />
            <br />
            <h3>Contactame</h3>
            <br />
            <br />
            <Form className='text-center m-auto'>
                <Form.Group style={{ width: "60%" }}>
                    <Form.Label>nombre</Form.Label>
                    <Form.Control type='text' onChange={(e) => setNombre(e.target.value)} />
                    <br />
                    <Form.Label>email</Form.Label>
                    <Form.Control type="text" onChange={handlerChange} />
                    <br />
                    <Form.Label type="text" >descripcion</Form.Label>
                    <Form.Control onChange={(e) => setDescripcion(e.target.value)} />

                </Form.Group>
            </Form>
            <br />
            <ul>

            {pedidos.map(pedido=><>
                <li>nombre: {pedido.nombre}</li>
                <li>email: {pedido.email}</li>
                <li>descripcion: {pedido.descripcion}</li>
                <br />
            </>)}
            </ul>
        </>
    )
}

export default MainContact
